//github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#parameterName) and [location](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#parameterIn). The list can use the [Reference Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#referenceObject) to link to parameters that are defined at the [Swagger Object\'s parameters](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#swaggerParameters). There can be one "body" parameter at most.',targetSpecs:Nve},{target:"parameters",docs:"[[Parameter Object](https://spec.openapis.org/oas/v3.0.4.html#parameter-object) &#124; [Reference Object](https://spec.openapis.org/oas/v3.0.4.html#reference-object)]\n\\\n\\\nA list of parameters that are applicable for all the operations described under this path. These parameters can be overridden at the operation level, but cannot be removed there. The list MUST NOT include duplicated parameters. A unique parameter is defined by a combination of a [name](https://spec.openapis.org/oas/v3.0.4.html#parameter-name) and [location](https://spec.openapis.org/oas/v3.0.4.html#parameter-in). The list can use the [Reference Object](https://spec.openapis.org/oas/v3.0.4.html#reference-object) to link to parameters that are defined at the [OpenAPI Object's components/parameters](https://spec.openapis.org/oas/v3.0.4.html#components-parameters).",targetSpecs:Fve},{target:"parameters",docs:"[[Parameter Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#parameterObject) &#124; [Reference Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#referenceObject)]\n\\\n\\\nA list of parameters that are applicable for all the operations described under this path. These parameters can be overridden at the operation level, but cannot be removed there. The list MUST NOT include duplicated parameters. A unique parameter is defined by a combination of a [name](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#parameterName) and [location](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#parameterIn). The list can use the [Reference Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#referenceObject) to link to parameters that are defined at the [OpenAPI Object's components/parameters](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#componentsParameters).",targetSpecs:Mve},{docs:'#### [Path Item Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#path-item-object)\n\nDescribes the operations available on a single path.\nA Path Item may be empty, due to [ACL constraints](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#securityFiltering). The path itself is still exposed to the documentation viewer but they will not know which operations and parameters are available.\n\n##### Fixed Fields\n\nField Name | Type | Description\n---|:---:|---\n$ref | `string` | Allows for an external definition of this path item. The referenced structure MUST be in the format of a [Path Item Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#pathItemObject). If there are conflicts between the referenced definition and this Path Item\'s definition, the behavior is *undefined*.\nget | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#operationObject) | A definition of a GET operation on this path.\nput | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#operationObject) | A definition of a PUT operation on this path.\npost | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#operationObject) | A definition of a POST operation on this path.\ndelete | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#operationObject) | A definition of a DELETE operation on this path.\noptions | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#operationObject) | A definition of a OPTIONS operation on this path.\nhead | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#operationObject) | A definition of a HEAD operation on this path.\npatch | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#operationObject) | A definition of a PATCH operation on this path.\nparameters | [[Parameter Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#parameterObject) \\| [Reference Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#referenceObject)] | A list of parameters that are applicable for all the operations described under this path. These parameters can be overridden at the operation level, but cannot be removed there. The list MUST NOT include duplicated parameters. A unique parameter is defined by a combination of a [name](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#parameterName) and [location](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#parameterIn). The list can use the [Reference Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#referenceObject) to link to parameters that are defined at the [Swagger Object\'s parameters](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#swaggerParameters). There can be one "body" parameter at most.\n\n##### Patterned Fields\n\nField Pattern | Type | Description\n---|:---:|---\n^x- | Any | Allows extensions to the Swagger Schema. The field name MUST begin with `x-`, for example, `x-internal-id`. The value can be `null`, a primitive, an array or an object. See [Vendor Extensions](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#vendorExtensions) for further details.\n\n##### Path Item Object Example\n\n```js\n{\n  "get": {\n    "description": "Returns pets based on ID",\n    "summary": "Find pets by ID",\n    "operationId": "getPetsById",\n    "produces": [\n      "application/json",\n      "text/html"\n    ],\n    "responses": {\n      "200": {\n        "description": "pet response",\n        "schema": {\n          "type": "array",\n          "items": {\n            "$ref": "#/definitions/Pet"\n          }\n        }\n      },\n      "default": {\n        "description": "error payload",\n        "schema": {\n          "$ref": "#/definitions/ErrorModel"\n        }\n      }\n    }\n  },\n  "parameters": [\n    {\n      "name": "id",\n      "in": "path",\n      "description": "ID of pet to use",\n      "required": true,\n      "type": "array",\n      "items": {\n        "type": "string"\n      },\n      "collectionFormat": "csv"\n    }\n  ]\n}\n```\n\n\n\\\nYAML\n```yaml\nget:\n  description: Returns pets based on ID\n  summary: Find pets by ID\n  operationId: getPetsById\n  produces:\n  - application/json\n  - text/html\n  responses:\n    \'200\':\n      description: pet response\n      schema:\n        type: array\n        items:\n          $ref: \'#/definitions/Pet\'\n    default:\n      description: error payload\n      schema:\n        $ref: \'#/definitions/ErrorModel\'\nparameters:\n- name: id\n  in: path\n  description: ID of pet to use\n  required: true\n  type: array\n  items:\n    type: string\n  collectionFormat: csv\n```',targetSpecs:Nve},{docs:'#### [Path Item Object](https://spec.openapis.org/oas/v3.0.4.html#path-item-object)\n\nDescribes the operations available on a single path.\nA Path Item MAY be empty, due to [ACL constraints](https://spec.openapis.org/oas/v3.0.4.html#security-filtering).\nThe path itself is still exposed to the documentation viewer but they will not know which operations and parameters are available.\n\n##### Fixed Fields\n\nField Name | Type | Description\n---|:---:|---\n$ref | `string` | Allows for an external definition of this path item. The referenced structure MUST be in the format of a [Path Item Object](https://spec.openapis.org/oas/v3.0.4.html#path-item-object).  In case a Path Item Object field appears both in the defined object and the referenced object, the behavior is undefined.\nsummary| `string` | An optional, string summary, intended to apply to all operations in this path.\ndescription | `string` | An optional, string description, intended to apply to all operations in this path. [CommonMark syntax](https://spec.commonmark.org/) MAY be used for rich text representation.\nget | [Operation Object](https://spec.openapis.org/oas/v3.0.4.html#operation-object) | A definition of a GET operation on this path.\nput | [Operation Object](https://spec.openapis.org/oas/v3.0.4.html#operation-object) | A definition of a PUT operation on this path.\npost | [Operation Object](https://spec.openapis.org/oas/v3.0.4.html#operation-object) | A definition of a POST operation on this path.\ndelete | [Operation Object](https://spec.openapis.org/oas/v3.0.4.html#operation-object) | A definition of a DELETE operation on this path.\noptions | [Operation Object](https://spec.openapis.org/oas/v3.0.4.html#operation-object) | A definition of a OPTIONS operation on this path.\nhead | [Operation Object](https://spec.openapis.org/oas/v3.0.4.html#operation-object) | A definition of a HEAD operation on this path.\npatch | [Operation Object](https://spec.openapis.org/oas/v3.0.4.html#operation-object) | A definition of a PATCH operation on this path.\ntrace | [Operation Object](https://spec.openapis.org/oas/v3.0.4.html#operation-object) | A definition of a TRACE operation on this path.\nservers | [[Server Object](https://spec.openapis.org/oas/v3.0.4.html#server-object)] | An alternative `server` array to service all operations in this path.\nparameters | [[Parameter Object](https://spec.openapis.org/oas/v3.0.4.html#parameter-object) \\| [Reference Object](https://spec.openapis.org/oas/v3.0.4.html#reference-object)] | A list of parameters that are applicable for all the operations described under this path. These parameters can be overridden at the operation level, but cannot be removed there. The list MUST NOT include duplicated parameters. A unique parameter is defined by a combination of a [name](https://spec.openapis.org/oas/v3.0.4.html#parameter-name) and [location](https://spec.openapis.org/oas/v3.0.4.html#parameter-in). The list can use the [Reference Object](#referenceObject) to link to parameters that are defined at the [OpenAPI Object\'s components/parameters](https://spec.openapis.org/oas/v3.0.4.html#components-parameters).\n\n\nThis object MAY be extended with [Specification Extensions](https://spec.openapis.org/oas/v3.0.4.html#specification-extensions).\n\n##### Path Item Object Example\n\n\n\\\nJSON\n```json\n{\n  "get": {\n    "description": "Returns pets based on ID",\n    "summary": "Find pets by ID",\n    "operationId": "getPetsById",\n    "responses": {\n      "200": {\n        "description": "pet response",\n        "content": {\n          "*/*": {\n            "schema": {\n              "type": "array",\n              "items": {\n                "$ref": "#/components/schemas/Pet"\n              }\n            }\n          }\n        }\n      },\n      "default": {\n        "description": "error payload",\n        "content": {\n          "text/html": {\n            "schema": {\n              "$ref": "#/components/schemas/ErrorModel"\n            }\n          }\n        }\n      }\n    }\n  },\n  "parameters": [\n    {\n      "name": "id",\n      "in": "path",\n      "description": "ID of pet to use",\n      "required": true,\n      "schema": {\n        "type": "array",\n        "items": {\n          "type": "string"\n        }\n      },\n      "style": "simple"\n    }\n  ]\n}\n```\n\n\n\\\nYAML\n```yaml\nget:\n  description: Returns pets based on ID\n  summary: Find pets by ID\n  operationId: getPetsById\n  responses:\n    \'200\':\n      description: pet response\n      content:\n        \'*/*\' :\n          schema:\n            type: array\n            items:\n              $ref: \'#/components/schemas/Pet\'\n    default:\n      description: error payload\n      content:\n        \'text/html\':\n          schema:\n            $ref: \'#/components/schemas/ErrorModel\'\nparameters:\n- name: id\n  in: path\n  description: ID of pet to use\n  required: true\n  schema:\n    type: array\n    items:\n      type: string\n  style: simple\n```',targetSpecs:Fve},{docs:'#### [Path Item Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#pathItemObject)\n\nDescribes the operations available on a single path. A Path Item MAY be empty, due to [ACL constraints](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#securityFiltering). The path itself is still exposed to the documentation viewer but they will not know which operations and parameters are available\n\n##### Fixed Fields\n\nField Name | Type | Description\n---|:---:|---\n$ref | `string` | Allows for a referenced definition of this path item. The referenced structure MUST be in the form of a [Path Item Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#pathItemObject). In case a Path Item Object field appears both in the defined object and the referenced object, the behavior is undefined. See the rules for resolving [Relative References](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#relativeReferencesURI).\nsummary | `string` | An optional, string summary, intended to apply to all operations in this path.\ndescription | `string` | A description of the API. [CommonMark syntax](https://spec.commonmark.org/) MAY be used for rich text representation.\tget | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#operationObject) | A definition of a GET operation on this path.\nput | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#operationObject) | A definition of a PUT operation on this path.\npost | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#operationObject) | A definition of a POST operation on this path.\ndelete | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#operationObject) | A definition of a DELETE operation on this path.\noptions | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#operationObject) | A definition of a OPTIONS operation on this path.\nhead | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#operationObject) | A definition of a HEAD operation on this path.\npatch | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#operationObject) | A definition of a PATCH operation on this path.\nget | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#operationObject) | A definition of a GET operation on this path.\ntrace | [Operation Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#operationObject) | A definition of a TRACE operation on this path.\nservers | [[Server Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#serverObject)] | An alternative `server` array to service all operations in this path.\nparamenters | [[Parameter](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#parameterObject) &#124; [Reference Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#referenceObject)] | A list of parameters that are applicable for all the operations described under this path. These parameters can be overridden at the operation level, but cannot be removed there. The list MUST NOT include duplicated parameters. A unique parameter is defined by a combination of a [name](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#parameterName) and [location](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#parameterIn). The list can use the [Reference Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#referenceObject) to link to parameters that are defined at the [OpenAPI Object\'s components/parameters](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#componentsParameters).\n\n\\\nThis object MAY be extended with [Specification Extensions](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#specificationExtensions).\n\n##### Paths Object Example\n\n\n\\\nJSON\n```json\n{\n  "get": {\n    "description": "Returns pets based on ID",\n    "summary": "Find pets by ID",\n    "operationId": "getPetsById",\n    "responses": {\n      "200": {\n        "description": "pet response",\n        "content": {\n          "*/*": {\n            "schema": {\n              "type": "array",\n              "items": {\n                "$ref": "#/components/schemas/Pet"\n              }\n            }\n          }\n        }\n      },\n      "default": {\n        "description": "error payload",\n        "content": {\n          "text/html": {\n            "schema": {\n              "$ref": "#/components/schemas/ErrorModel"\n            }\n          }\n        }\n      }\n    }\n  },\n  "parameters": [\n    {\n      "name": "id",\n      "in": "path",\n      "description": "ID of pet to use",\n      "required": true,\n      "schema": {\n        "type": "array",\n        "items": {\n          "type": "string"\n        }\n      },\n      "style": "simple"\n    }\n  ]\n}\n```\n\n\n\\\nYAML\n```yaml\nget:\n  description: Returns pets based on ID\n  summary: Find pets by ID\n  operationId: getPetsById\n  responses:\n    \'200\':\n      description: pet response\n      content:\n        \'*/*\' :\n          schema:\n          type: array\n          items:\n            $ref: \'#/components/schemas/Pet\'\n    default:\n      description: error payload\n      content:\n        \'text/html\':\n        schema:\n          $ref: \'#/components/schemas/ErrorModel\'\nparameters:\n- name: id\n  in: path\n  description: ID of pet to use\n  required: true\n  schema:\n    type: array\n    items:\n      type: string\n  style: simple\n```\n',targetSpecs:Mve}],Tgt=Sgt,Agt={lint:ygt,completion:vgt,documentation:Tgt},Ogt=Agt,Igt={code:N_e.OPENAPI2_PATHS_VALUES_TYPE,source:"apilint",message:"Paths Object values must be of Path Item Object shape",severity:Pt.DiagnosticSeverity.Error,linterFunction:"apilintChildrenOfElementsOrClasses",linterParams:[["pathItem"]],marker:"key",data:{},targetSpecs:[...Nve,...Lve]},Pgt=Igt,wgt=[Pgt],xgt=wgt,Ngt=[{docs:'#### [Paths Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#paths-object)\n\nHolds the relative paths to the individual endpoints. The path is appended to the [`basePath`](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#swaggerBasePath) in order to construct the full URL.\nThe Paths may be empty, due to [ACL constraints](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#securityFiltering).\n\n##### Patterned Fields\n\nField Pattern | Type | Description\n---|:---:|---\n/{path} | [Path Item Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#pathItemObject) | A relative path to an individual endpoint. The field name MUST begin with a slash. The path is appended to the [`basePath`](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#swaggerBasePath) in order to construct the full URL. [Path templating](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#pathTemplating) is allowed.\n^x- | Any | Allows extensions to the Swagger Schema. The field name MUST begin with `x-`, for example, `x-internal-id`. The value can be `null`, a primitive, an array or an object. See [Vendor Extensions](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/2.0.md#vendorExtensions) for further details.\n\n##### Paths Object Example\n\n```js\n{\n  "/pets": {\n    "get": {\n      "description": "Returns all pets from the system that the user has access to",\n      "produces": [\n        "application/json"\n      ],\n      "responses": {\n        "200": {\n          "description": "A list of pets.",\n          "schema": {\n            "type": "array",\n            "items": {\n              "$ref": "#/definitions/pet"\n            }\n          }\n        }\n      }\n    }\n  }\n}\n```\n\n\n\\\nYAML\n```yaml\n/pets:\n  get:\n    description: Returns all pets from the system that the user has access to\n    produces:\n    - application/json\n    responses:\n      \'200\':\n        description: A list of pets.\n        schema:\n          type: array\n          items:\n            $ref: \'#/definitions/pet\'\n```',targetSpecs:Nve},{docs:'#### [Paths Object](https://spec.openapis.org/oas/v3.0.4.html#paths-object)\n\nHolds the relative paths to the individual endpoints and their operations.\nThe path is appended to the URL from the [`Server Object`](https://spec.openapis.org/oas/v3.0.4.html#server-object) in order to construct the full URL.  The Paths MAY be empty, due to [ACL constraints](https://spec.openapis.org/oas/v3.0.4.html#security-filtering).\n\n##### Patterned Fields\n\nField Pattern | Type | Description\n---|:---:|---\n/{path} | [Path Item Object](https://spec.openapis.org/oas/v3.0.4.html#path-item-object) | A relative path to an individual endpoint. The field name MUST begin with a forward slash (`/`). The path is **appended** (no relative URL resolution) to the expanded URL from the [`Server Object`](https://spec.openapis.org/oas/v3.0.4.html#server-object)\'s `url` field in order to construct the full URL. [Path templating](https://spec.openapis.org/oas/v3.0.4.html#path-templating) is allowed. When matching URLs, concrete (non-templated) paths would be matched before their templated counterparts. Templated paths with the same hierarchy but different templated names MUST NOT exist as they are identical. In case of ambiguous matching, it\'s up to the tooling to decide which one to use.\n\nThis object MAY be extended with [Specification Extensions](https://spec.openapis.org/oas/v3.0.4.html#specification-extensions).\n\n##### Path Templating Matching\n\nAssuming the following paths, the concrete definition, `/pets/mine`, will be matched first if used:\n\n```\n  /pets/{petId}\n  /pets/mine\n```\n\nThe following paths are considered identical and invalid:\n\n```\n  /pets/{petId}\n  /pets/{name}\n```\n\nThe following may lead to ambiguous resolution:\n\n```\n  /{entity}/me\n  /books/{id}\n```\n\n##### Paths Object Example\n\n\n\\\nJSON\n```json\n{\n  "/pets": {\n    "get": {\n      "description": "Returns all pets from the system that the user has access to",\n      "responses": {\n        "200": {\n          "description": "A list of pets.",\n          "content": {\n            "application/json": {\n              "schema": {\n                "type": "array",\n                "items": {\n                  "$ref": "#/components/schemas/pet"\n                }\n              }\n            }\n          }\n        }\n      }\n    }\n  }\n}\n```\n\n\n\\\nYAML\n```yaml\n/pets:\n  get:\n    description: Returns all pets from the system that the user has access to\n    responses:\n      \'200\':\n        description: A list of pets.\n        content:\n          application/json:\n            schema:\n              type: array\n              items:\n                $ref: \'#/components/schemas/pet\'\n```',targetSpecs:Fve},{docs:'#### [Paths Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#pathsObject)\n\nHolds the relative paths to the individual endpoints and their operations. The path is appended to the URL from the [`Server Object`](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#serverObject) in order to construct the full URL. The Paths MAY be empty, due to [Access Control List (ACL) constraints](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#securityFiltering).\n\n##### Patterned Fields\n\nField Pattern | Type | Description\n---|:---:|---\n/{path} | [Path Item Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#pathItemObject) | A relative path to an individual endpoint. The field name MUST begin with a forward slash (`/`). The path is **appended** (no relative URL resolution) to the expanded URL from the [Server Object\'s](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#serverObject) `url` field in order to construct the full URL. [Path templating](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#pathTemplating) is allowed. When matching URLs, concrete(non-templated) paths would be matched before their templated counterparts. Templated paths with the same hierarchy but different templated names MUST NOT exist as they are identical.In case of ambiguous matching, it is up to the tooling to decide which one to use.\n\n\\\nThis object MAY be extended with [Specification Extensions](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#specificationExtensions).\n\n##### Path Templating Matching\n\n\n\\\nAssuming the following paths, the concrete definition, `/pets/mine`, will be matched first if used:\n\n\n```yaml\n  /pets/{petId}\n  /pets/mine\n```\n\n\nThe following paths are considered identical and invalid:\n\n\n```yaml\n  /pets/{petId}\n  /pets/{name}\n```\n\n\nThe following may lead to ambiguous resolution:\n\n```yaml\n  /{entity}/me\n  /books/{id}\n```\n\n##### Paths Object Example\n\n\n\\\nJSON\n```json\n{\n  "/pets": {\n    "get": {\n      "description": "Returns all pets from the system that the user has access to",\n      "responses": {\n        "200": {\n          "description": "A list of pets.",\n          "content": {\n            "application/json": {\n              "schema": {\n                "type": "array",\n                "items": {\n                  "$ref": "#/components/schemas/pet"\n                }\n              }\n            }\n          }\n        }\n      }\n    }\n  }\n}\n```\n\n\n\\\nYAML\n```yaml\n  /pets:\n    get:\n      description: Returns all pets from the system that the user has access to\n      responses:\n        \'200\':\n          description: A list of pets.\n          content:\n            application\\/ json:\n              schema:\n                type: array\n                items:\n                  $ref: \'#/components/schemas/pet\'\n```\n',targetSpecs:Mve}],Rgt=Ngt,Dgt={lint:xgt,documentation:Rgt},Cgt=Dgt,kgt={code:N_e.NOT_ALLOWED_FIELDS,source:"apilint",message:"Object includes not allowed fields",severity:Pt.DiagnosticSeverity.Error,linterFunction:"allowedFields",linterParams:[["description","content","required","$ref"],"x-"],marker:"key",targetSpecs:Fve},Fgt=kgt,Mgt={code:N_e.NOT_ALLOWED_FIELDS,source:"apilint",message:"Object includes not allowed fields",severity:Pt.DiagnosticSeverity.Error,linterFunction:"allowedFields",linterParams:[["description","content","required"],"x-"],marker:"key",conditions:[{function:"missingField",params:["$ref"]}],targetSpecs:Mve},Lgt=Mgt,jgt={code:N_e.OPENAPI3_0_REQUEST_BODY_FIELD_DESCRIPTION_TYPE,source:"apilint",message:"description must be a string",severity:Pt.DiagnosticSeverity.Error,linterFunction:"apilintType",linterParams:["string"],marker:"value",target:"description",data:{},targetSpecs:Lve},Ugt=jgt,Bgt={code:N_e.OPENAPI3_0_REQUEST_BODY_FIELD_CONTENT_VALUES_TYPE,source:"apilint",message:'"content" members must be Media Type Object',severity:Pt.DiagnosticSeverity.Error,linterFunction:"apilintChildrenOfElementsOrClasses",linterParams:[["mediaType"]],marker:"key",markerTarget:"content",target:"content",data:{},targetSpecs:Lve},Ygt=Bgt,qgt={code:N_e.OPENAPI3_0_REQUEST_BODY_FIELD_CONTENT_REQUIRED,source:"apilint",message:"should always have a 'content'",severity:Pt.DiagnosticSeverity.Error,linterFunction:"hasRequiredField",linterParams:["content"],marker:"key",data:{quickFix:[{message:"add 'content' field",action:"addChild",snippetYaml:"content: \n  \n",snippetJson:'"content": {\n  \n  },\n'}]},conditions:[{function:"missingField",params:["$ref"]}],targetSpecs:Lve},Vgt=qgt,$gt={code:N_e.OPENAPI3_0_REQUEST_BODY_FIELD_REQUIRED_TYPE,source:"apilint",message:"required must be a boolean",severity:Pt.DiagnosticSeverity.Error,linterFunction:"apilintType",linterParams:["boolean"],marker:"value",target:"required",data:{},targetSpecs:Lve},Hgt=$gt,Ggt=[Ugt,Vgt,Ygt,Hgt,Fgt,Lgt],Qgt=Ggt,Kgt=[{label:"$ref",insertText:"\\$ref",kind:14,format:Yme.QUOTED,type:Bme.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"A reference to a Request Body."},targetSpecs:Lve},{label:"description",insertText:"description",kind:14,format:Yme.QUOTED,type:Bme.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"A brief description of the request body. This could contain examples of use. [CommonMark syntax](https://spec.commonmark.org/) MAY be used for rich text representation."},targetSpecs:Lve},{label:"content",insertText:"content",kind:14,format:Yme.OBJECT,type:Bme.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"Map[`string`, [Media Type Object](https://spec.openapis.org/oas/v3.0.4.html#media-type-object)]\n\\\n\\\n**REQUIRED**. The content of the request body. The key is a media type or [media type range](https://tools.ietf.org/html/rfc7231#appendix-D) and the value describes it.  For requests that match multiple keys, only the most specific key is applicable. e.g. text/plain overrides text/*"},targetSpecs:Fve},{label:"content",insertText:"content",kind:14,format:Yme.OBJECT,type:Bme.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"Map[`string`, [Media Type Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#mediaTypeObject)]\n\\\n\\\n**REQUIRED**. The content of the request body. The key is a media type or [media type range](https://tools.ietf.org/html/rfc7231#appendix-D) and the value describes it.  For requests that match multiple keys, only the most specific key is applicable. e.g. text/plain overrides text/*"},targetSpecs:Mve},{label:"required",insertText:"required",kind:14,format:Yme.UNQUOTED,type:Bme.PROPERTY,insertTextFormat:2,documentation:{kind:"markdown",value:"Determines if the request body is required in the request. Defaults to `false`."},targetSpecs:Lve}],Wgt=Kgt,Jgt=[{target:"description",docs:"A brief description of the request body. This could contain examples of use. [CommonMark syntax](https://spec.commonmark.org/) MAY be used for rich text representation.",targetSpecs:Lve},{target:"content",docs:"Map[`string`, [Media Type Object](https://spec.openapis.org/oas/v3.0.4.html#media-type-object)]\n\\\n\\\n**REQUIRED**. The content of the request body. The key is a media type or [media type range](https://tools.ietf.org/html/rfc7231#appendix-D) and the value describes it.  For requests that match multiple keys, only the most specific key is applicable. e.g. text/plain overrides text/*",targetSpecs:Fve},{target:"content",docs:"Map[`string`, [Media Type Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#mediaTypeObject)]\n\\\n\\\n**REQUIRED**. The content of the request body. The key is a media type or [media type range](https://tools.ietf.org/html/rfc7231#appendix-D) and the value describes it.  For requests that match multiple keys, only the most specific key is applicable. e.g. text/plain overrides text/*",targetSpecs:Mve},{target:"required",docs:"Determines if the request body is required in the request. Defaults to `false`.",targetSpecs:Lve},{docs:'#### [Request Body Object](https://spec.openapis.org/oas/v3.0.4.html#request-body-object)\n\nDescribes a single request body.\n\n##### Fixed Fields\nField Name | Type | Description\n---|:---:|---\ndescription | `string` | A brief description of the request body. This could contain examples of use.  [CommonMark syntax](https://spec.commonmark.org/) MAY be used for rich text representation.\ncontent | Map[`string`, [Media Type Object](https://spec.openapis.org/oas/v3.0.4.html#media-type-object)] | **REQUIRED**. The content of the request body. The key is a media type or [media type range](https://tools.ietf.org/html/rfc7231#appendix-D) and the value describes it.  For requests that match multiple keys, only the most specific key is applicable. e.g. text/plain overrides text/*\nrequired | `boolean` | Determines if the request body is required in the request. Defaults to `false`.\n\n\nThis object MAY be extended with [Specification Extensions](https://spec.openapis.org/oas/v3.0.4.html#specification-extensions).\n\n##### Request Body Examples\n\nA request body with a referenced model definition.\n\n\\\nJSON\n```json\n{\n  "description": "user to add to the system",\n  "content": {\n    "application/json": {\n      "schema": {\n        "$ref": "#/components/schemas/User"\n      },\n      "examples": {\n          "user" : {\n            "summary": "User Example",\n            "externalValue": "http://foo.bar/examples/user-example.json"\n          }\n        }\n    },\n    "application/xml": {\n      "schema": {\n        "$ref": "#/components/schemas/User"\n      },\n      "examples": {\n          "user" : {\n            "summary": "User example in XML",\n            "externalValue": "http://foo.bar/examples/user-example.xml"\n          }\n        }\n    },\n    "text/plain": {\n      "examples": {\n        "user" : {\n            "summary": "User example in Plain text",\n            "externalValue": "http://foo.bar/examples/user-example.txt"\n        }\n      }\n    },\n    "*/*": {\n      "examples": {\n        "user" : {\n            "summary": "User example in other format",\n            "externalValue": "http://foo.bar/examples/user-example.whatever"\n        }\n      }\n    }\n  }\n}\n```\n\n\n\\\nYAML\n```yaml\ndescription: user to add to the system\ncontent:\n  \'application/json\':\n    schema:\n      $ref: \'#/components/schemas/User\'\n    examples:\n      user:\n        summary: User Example\n        externalValue: \'http://foo.bar/examples/user-example.json\'\n  \'application/xml\':\n    schema:\n      $ref: \'#/components/schemas/User\'\n    examples:\n      user:\n        summary: User Example in XML\n        externalValue: \'http://foo.bar/examples/user-example.xml\'\n  \'text/plain\':\n    examples:\n      user:\n        summary: User example in text plain format\n        externalValue: \'http://foo.bar/examples/user-example.txt\'\n  \'*/*\':\n    examples:\n      user:\n        summary: User example in other format\n        externalValue: \'http://foo.bar/examples/user-example.whatever\'\n```\n\nA body parameter that is an array of string values:\n```json\n{\n  "description": "user to add to the system",\n  "content": {\n    "text/plain": {\n      "schema": {\n        "type": "array",\n        "items": {\n          "type": "string"\n        }\n      }\n    }\n  }\n}\n```\n\n```yaml\ndescription: user to add to the system\nrequired: true\ncontent:\n  text/plain:\n    schema:\n      type: array\n      items:\n        type: string\n```',targetSpecs:Fve},{docs:'#### [Request Body Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#requestBodyObject)\n\nDescribes a single request body.\n\n##### Fixed Fields\nField Name | Type | Description\n---|:---:|---\ndescription | `string` | A brief description of the request body. This could contain examples of use.  [CommonMark syntax](https://spec.commonmark.org/) MAY be used for rich text representation.\ncontent | Map[`string`, [Media Type Object](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#mediaTypeObject)] | **REQUIRED**. The content of the request body. The key is a media type or [media type range](https://tools.ietf.org/html/rfc7231#appendix-D) and the value describes it.  For requests that match multiple keys, only the most specific key is applicable. e.g. text/plain overrides text/*\nrequired | `boolean` | Determines if the request body is required in the request. Defaults to `false`.\n\n\\\nThis object MAY be extended with [Specification Extensions](https://github.com/OAI/OpenAPI-Specification/blob/main/versions/3.1.0.md#specificationExtensions).\n\n##### Request Body Examples\n\nA request body with a referenced model definition.\n\n\\\nJSON\n```json\n{\n  "description": "user to add to the system",\n  "content": {\n    "application/json": {\n      "schema": {\n        "$ref": "#/components/schemas/User"\n      },\n      "examples": {\n          "user" : {\n            "summary": "User Example", \n            "externalValue": "https://foo.bar/examples/user-example.json"\n          } \n        }\n    },\n    "application/xml": {\n      "schema": {\n        "$ref": "#/components/schemas/User"\n      },\n      "examples": {\n          "user" : {\n            "summary": "User example in XML",\n            "externalValue": "https://foo.bar/examples/user-example.xml"\n          }\n        }\n    },\n    "text/plain": {\n      "examples": {\n        "user" : {\n            "summary": "User example in Plain text",\n            "externalValue": "https://foo.bar/examples/user-example.txt" \n        }\n      } \n    },\n    "*/*": {\n      "examples": {\n        "user" : {\n            "summary": "User example in other format",\n            "externalValue": "https://foo.bar/examples/user-example.whatever"\n        }\n      }\n    }\n  }\n}\n```\n\n\n\\\nYAML\n```yaml\ndescription: user to add to the system\ncontent: \n  \'application/json\':\n    schema:\n      $ref: \'#/components/schemas/User\'\n    examples:\n      user:\n        summary: User Example\n        externalValue: \'https://foo.bar/examples/user-example.json\'\n  \'application/xml\':\n    schema:\n      $ref: \'#/components/schemas/User\'\n    examples:\n      user:\n        summary: User example in XML\n        externalValue: \'https://foo.bar/examples/user-example.xml\'\n  \'text/plain\':\n    examples:\n      user:\n        summary: User example in Plain text\n        externalValue: \'https://foo.bar/examples/user-example.txt\'\n  \'*/*\':\n    examples:\n      user: \n        summary: User example in other format\n        externalValue: \'https://foo.bar/examples/user-example.whatever\'\n```\n\nA body parameter that is an array of string values:\n```json\n{\n  "description": "user to add to the system",\n  "required": true,\n  "content": {\n    "text/plain": {\n      "schema": {\n        "type": "array",\n        "items": {\n          "type": "string"\n        }\n      }\n    }\n  }\n}\n```\n\n```yaml\ndescription: user to add to the system\nrequired: true\ncontent:\n  text/plain:\n    schema:\n      type: array\n      items:\n        type: string\n```',targetSpecs:Mve}],zgt=Jgt,Xgt={lint:Qgt,completion:Wgt,documentation:zgt},Zgt=Xgt,eft={code:N_e.NOT_ALLOWED_FIELDS,source:"apilint",message:"Object includes not allowed fields",severity:Pt.DiagnosticSeverity.Error,linterFunction:"allowedFields",linterParams:[["description","schema","headers","examples","$ref"],"x-"],marker:"key",targetSpecs:Nve},tft=eft,nft={code:N_e.NOT_ALLOWED_FIELDS,source:"apilint",message:"Object includes not allowed fields",severity:Pt.DiagnosticSeverity.Error,linterFunction:"allowedFields",linterParams:[["description","headers","content","links","$ref"],"x-"],marker:"key",targetSpecs:Fve},sft=nft,ift={code:N_e.NOT_ALLOWED_FIELDS,source:"apilint",message:"Object includes not allowed fields",severity:Pt.DiagnosticSeverity.Error,linterFunction:"allowedFields",linterParams:[["description","headers","content","links"],"x-"],marker:"key",conditions:[{function:"missingField",params:["$ref"]}],targetSpecs:Mve},rft=ift,aft={code:N_e.OPE